<pre><code>import axios from "axios";
import { Field, Form, FormikProps, withFormik } from "formik";
import React from "react";
import * as Yup from "yup";

interface FormValues {
  email: string;
  password: string;
}

interface MyFormProps {
  initialEmail?: string;
  initialPassword?: string;
}

class RegisterForm extends React.PureComponent&lt;FormikProps&lt;FormValues&gt;&gt; {
  render() {
    const { values, touched, errors, isSubmitting } = this.props;
    return (
      &lt;Form&gt;
        &lt;Field
          type="email"
          name="email"
          placeholder="email"
          value={values.email}
        /&gt;
        {touched.email &amp;&amp; errors.email &amp;&amp; &lt;div&gt;{errors.email}&lt;/div&gt;}
        &lt;Field
          type="password"
          name="password"
          placeholder="password"
          value={values.password}
        /&gt;
        {touched.password &amp;&amp; errors.password &amp;&amp; &lt;div&gt;{errors.password}&lt;/div&gt;}
        &lt;button type="submit" disabled={isSubmitting}&gt;
          Submit
        &lt;/button&gt;
      &lt;/Form&gt;
    );
  }
}

const FormikRegisterForm = withFormik&lt;MyFormProps, FormValues&gt;({
  mapPropsToValues: props =&gt; {
    return {
      email: props.initialEmail || "",
      password: ""
    };
  },
  validationSchema: Yup.object().shape({
    login: Yup.string()
      .email("email is not valid")
      .required("email is required"),
    password: Yup.string().required("password is required")
  }),
  handleSubmit(values) {
    const { email, password } = values;
    axios
      .post("/api/register", {
        email,
        password
      })
      .then(res =&gt; {
        console.log(res);
      })
      .catch(err =&gt; {
        console.log(err);
      });
  }
})(RegisterForm);

export default FormikRegisterForm;
</code></pre>

<p>What can I change to get the desired result it database after clicking submit button in register form? Thanks for help in advance.</p>

