MongoDB Stitch trigger delay<p>Are there known delays with MongoDB Stitch triggers? I see a 1-2 minute gap between authentication events and trigger completion.</p>

<p>I have a simple <a href="https://docs.mongodb.com/stitch/triggers/authentication-triggers/" rel="nofollow noreferrer">Authentication Trigger</a> which executes on <strong>Create</strong>. In other words, the trigger fires when a new user is added.</p>

<p>The trigger calls the function below to add the new user to a temporary collection.</p>

<pre><code>exports = async function(authEvent) {
  const mongodb = context.services.get("mongodb-atlas");
  const newUsers = mongodb.db("DATABASE").collection("newUsers");

  const { user, time } = authEvent;
  const newUser = { ...user, eventLog: [ { "created": time } ], access: [{"status": "pending"}] };
  await newUsers.insertOne(newUser);
}
</code></pre>

<p>The results are shown below. The <strong>authEvent</strong> records user creation time as <em>11:40</em>. However, the new document isn't inserted until <em>11:42</em>.</p>

